import React from "react";
import shirtImg from "../assets/shirt.jpg";
import hoodieImg from "../assets/hoodie.jpg";
import hneckImg from "../assets/highnecktshirt.png";

const outfits = [
  { id: 1, name: "Shirt", image: shirtImg, model: "/models/shirt.gltf" },
  { id: 2, name: "Hoodie", image: hoodieImg, model: "/models/hoodie.gltf" },
  { id: 3, name: "High Neck Tshirt", image: hneckImg, model: "/models/highnecktshirt.glb" }
];

const OutfitSelection = ({ onSelect }) => {
  return (
    <div>
      <h2>Select an Outfit</h2>
      <div style={{ display: "flex", gap: "20px" }}>
        {outfits.map((outfit) => (
          <div key={outfit.id} onClick={() => onSelect(outfit.model)} style={{ cursor: "pointer" }}>
            <img src={outfit.image} alt={outfit.name} width="100" />
            <p>{outfit.name}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default OutfitSelection;
